function calculateDominicanPayroll(t){if("number"!=typeof t)return null;const e={threshold:34685,rate:.15,fixedAmount:0},o={threshold:52027.4167,rate:.2,fixedAmount:2601.33},l={threshold:72260.25,rate:.25,fixedAmount:6648},r=.0304*t,h=.0287*t,n=t-(r+h);let s=0;if(n>=l.threshold){const t=n-l.threshold;s=l.fixedAmount+t*l.rate}else if(n<l.threshold&&n>=o.threshold){const t=n-o.threshold;s=o.fixedAmount+t*o.rate}else if(n<o.threshold&&n>=e.threshold){const t=n-e.threshold;s=e.fixedAmount+t*e.rate}return{monthlySalary:t,netMonthlySalary:n-s,sfs:r,afp:h,isr:s,deductions:r+h+s}}export default calculateDominicanPayroll;